_.groupByMulti = function(obj, values, context) {
    if (!values.length)
        return obj;
    var byFirst = _.groupBy(obj, values[0], context),
        rest = values.slice(1);
    for (var prop in byFirst) {
        byFirst[prop] = _.groupByMulti(byFirst[prop], rest, context);
    }
    return byFirst;
};


_.groupBygroup = function(data, key, index, delimiter) {
    var SIM = {};
    _.map(data, function(o) {
        if (o[key[index]] !== undefined) {
            var d = o[key[index]].split(delimiter);
            for (var i in d) {
                if (d[i] !== '') {
                    if (SIM[d[i]] === undefined) {
                        SIM[d[i]] = 0;
                    }
                    SIM[d[i]]++;
                }
                return o;
            }
        }
    });
    var keys = key;
    keys = keys.slice(1);
    /**/
    var obj = {};
    var i = index === 0 ? 1 : 0;
    if (key[i] !== undefined) {
        for (var o in SIM) {
            var f = _.filter(data, function(obj) {
                return _.contains(obj[key[index]].split(delimiter), o)
            });
            var g = _.groupBy(f, function(obj) {
                return obj[key[i]]
            });
            obj[o] = g;
        }
    } else {
        obj = SIM;
    }
    var keysall = [];
    if (index !== 0) {
        for (var a in obj) {
            keysall = _.union(keysall, _.keys(obj[a]));
        }
        console.log(keysall);
        var objfinal = {};
        for (var k in keysall) {
            console.log(keysall[k]);
            objfinal[keysall[k]] = {};
            for (var a in obj) {
                if (obj[a][keysall[k]] !== undefined) {
                    objfinal[keysall[k]][a] = obj[a][keysall[k]];
                }
            }
        }
        obj = objfinal;
        // console.log(objfinal);
    }

    // console.log(SIM);
    // console.log(obj);
    /**/
    return obj;
}
_.mixin({
    'sortKeysBy': function(obj, comparator) {
        var keys = _.sortBy(_.keys(obj), function(key) {
            return comparator ? comparator(obj[key], key) : key;
        });

        return _.object(keys, _.map(keys, function(key) {
            return obj[key];
        }));
    }
});
